import * as SecureStore from 'expo-secure-store';
import AsyncStorage from '@react-native-async-storage/async-storage';
const saveTokenAsync = async (accessToken) => {
    try {
        await SecureStore.setItemAsync(
            'token',
            accessToken
        );
    } catch (error) {
        console.log("Error in saving Access Token: ", error);
    }
}

const retrieveTokenAsync = async () => {
    try {
        return (
            SecureStore.getItemAsync('token')
        );
    } catch (error) {
        console.log("Error in retrieving Access Token");
    }
}
const saveUnsecured = async (accessToken) => {
    try {
        await AsyncStorage.setItem(
            'token',
            accessToken
        );
    } catch (error) {
        console.log("Error in saving Access Token: ", error);
    }
}

const retrieveUnsecured = async () => {
    try {
        return (
            accessToken = await AsyncStorage.getItem('token')
        );
    } catch (error) {
        console.log("Error in retrieving Access Token");
    }
}
export {
    saveTokenAsync,
    retrieveTokenAsync,
    saveUnsecured,
    retrieveUnsecured
};
